import {Avatar, Card} from 'antd';

const SkillCard=({setMySkill})=>{
    return(
        <Card>
            <p>{setMySkill.skillName}</p>
            <p>{setMySkill.skillAbility}</p>
        </Card>
    )
}

export default SkillCard;
